def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    priorities = np.zeros_like(bins)

    for i in range(len(bins)):
        if item > bins[i]:
            priorities[i] = 0
        else:
            remaining_space = bins[i] - item
            utilization_ratio = remaining_space / bins[i]

            if utilization_ratio < 0.2:
                priority_score = 1 / (1 + utilization_ratio)
            elif utilization_ratio >= 0.2 and utilization_ratio < 0.5:
                priority_score = 0.6 / (1 + utilization_ratio)
            elif utilization_ratio >= 0.5 and utilization_ratio < 0.7:
                priority_score = 0.4 / (1 + utilization_ratio)
            elif utilization_ratio >= 0.7 and utilization_ratio < 0.9:
                priority_score = 0.2 / (1 + utilization_ratio)
            else:
                priority_score = 0.1 / (1 + utilization_ratio)

            if remaining_space >= 5:
                priority_score *= 1.3
            elif remaining_space >= 3:
                priority_score *= 1.2

            if bins[i] >= 20:
                priority_score *= 1.5
            elif bins[i] >= 10:
                priority_score *= 1.3
            elif bins[i] >= 5:
                priority_score *= 1.1

            if item < 5:
                priority_score += 0.3
            elif item >= 5 and item < 10:
                priority_score += 0.2
            elif item >= 10 and item < 15:
                priority_score += 0.1

            if bins[i] < 5:
                priority_score += 0.2
            elif bins[i] >= 5 and bins[i] < 10:
                priority_score += 0.1

            if item % 2 == 0:
                priority_score += 0.1

            if bins[i] % 2 == 0:
                priority_score += 0.2

            priorities[i] = priority_score

    return priorities
